import React from 'react';
import './Header.css'; // Create this CSS file for styling
import logo from '.../Assets/logo.png'; // Replace with your logo image

const Header = () => {
  return (
    <header className="header">
      <div className="menu">
        <nav>
          <ul>
            <li>Home</li>
            <li>About</li>
            <li>Contact Us</li>
            <li>Sign In</li>
          </ul>
        </nav>
      </div>
      <div className="logo">
        <img src={logo} alt="Logo" />
      </div>
    </header>
  );
};

export default Header;
